import AppWrapper from "../AppWrapper";
import WalletContext from "../WalletContext";

const WalletLanding = () => {
  const walletId = useContext(WalletContext);

  return (
    <AppWrapper>
      {walletId ? <>Debit/Credit</> : <>Setup wallet</>}
    </AppWrapper>
  );
}

export default WalletLanding;
